import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import {NavLink} from 'react-router-dom';
import { LinkContainer } from 'react-router-bootstrap';
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Cat1 from "../toy_examples/media/cats/00000001_000.jpg";
import Cat2 from "../toy_examples/media/cats/00000001_008.jpg";
import Cat3 from "../toy_examples/media/cats/00000001_005.jpg";
export function ExamplePage() {
    return (
        <div id="cat-output-demonstration">
            <Container fluid>
                <Row>
                    <Col id="col00">
                        <img src={Cat1} alt="Cat" />;
                    </Col>
                    <Col id="col01"><img src={Cat2} alt="Cat" />;</Col>
                    <Col id={"col02"}><img src={Cat3} alt="Cat" /></Col>
                </Row>
            </Container>
        </div>
    );
}
